import React, { Component } from "react";
import { Row, Col } from "reactstrap";

class WeiboCard extends Component {
  render() {
    return (
      <div>
        <Row>
          <Col>
            <div className="image-container">
              <img src={require("../../assets/appicon_bw.png")} />
            </div>
          </Col>
          <Col>
            <div className="image-container">
              <img src={require("../../assets/appicon_color.png")} />
            </div>
          </Col>
        </Row>
        <div className="image-container">
          <img src={require("../../assets/bambookeeper.png")} />
        </div>
        <div className="image-container">
          <img src={require("../../assets/lbs_example.png")} />
        </div>
        <div className="image-container">
          <img src={require("../../assets/lbswireframe.png")} />
        </div>
      </div>
    );
  }
}

export default WeiboCard;
